import "./App.css";
import Icon from "./components/Icon";

function App() {
	return (
		<div className="App">
			<header className="App-header">
        <Icon></Icon>
        <pen></pen>
				<a
					className="App-link"
					href="https://reactjs.org"
					target="_blank"
					rel="noopener noreferrer"
				>
					Learn React
				</a>
			</header>
		</div>
	);
}

export default App;
